    <div className='section-centre'>
   {menuItems.map((menuItem)=>{
    const{id, price, title, img, desc} = menuItem
    return (
        <article key={id} className='menu-item'>
        <img src={img} alt={title} className='photo'/>
        <div className='item-info'>
    <header>
        <h4>{title}</h4>
        <h4>${price}</h4>
        
            </header>

</div>
        </article>
    )
   })}
    </div>
  )
}

export default Menu
